graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Abstract" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Abstract</b> <i>@Singleton @Async @Deprecated @Critical @ReadOnly</i></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style="filled,dashed", color="#000000", fontcolor="#999999", penwidth=3, peripheries=2];

}
